import React from 'react';
import './App.css';
import Classifier from './components/Classifier/Classifier';
import {Route, BrowserRouter, Routes} from 'react-router-dom'

function App() {
  return (
      <div className='App'>


        <Routes>
          <Route exact path='/' element={Classifier} />

          <Route exact path='*' element={Classifier} />
        </Routes>

      </div>

  );
}

export default App;
